import React from "react";
import "./styles/HistoryItem.css";

function HistoryItem({ title, date, description, points, status, isPositive }) {
    return (
        <div className={`history-item ${isPositive ? 'positive' : 'negative'}`}>
            <div className="history-item-header">
                <div className="history-item-title">{title}</div>
                <div className="history-item-date">{date}</div>
            </div>
            <div className="history-item-body">
                <div className="history-item-description">{description}</div>
                <div className="history-item-points">{points}</div>
            </div>
            <div className="history-item-status">{status}</div>
        </div>
    );
}

export default HistoryItem;
